  "geo" : {
  },
  "id_str" : "182471395639427073",
  "text" : "そういえば、高校の微積分では関数の最小最大値を探す問題で代数方程式までしか出てこなくて、三角関数も指数対数関数も逆三角関数も出てこないと聞いたときは驚いたなー。 #高専生あるある",
