  "id_str" : "182081759846993921",
  "text" : "まぁそういう安全かどうかという意識をもって選ぶのは大事だけど、そんなことよりも日常生活のしやすさとか快適さを優先した方がいいと思います。大事なのは、災害の危険性のある土地に住むのを避けるのではなくて（日本にいる限り無理だけど）、どんな災害にあいやすいかを知って対策しておくこと。",
